[{"location":"","page":"Home","title":"Home","text":"CurrentModule = ExtendedDates","category":"page"},{"location":"#ExtendedDates","page":"Home","title":"ExtendedDates","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for ExtendedDates.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [ExtendedDates]","category":"page"},{"location":"#ExtendedDates.Semester-Tuple{Any}","page":"Home","title":"ExtendedDates.Semester","text":"Semester(v)\n\nConstruct a Semester object with the given v value. Input must be losslessly convertible to an Int64.\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.Semester-Tuple{DateTime}","page":"Home","title":"ExtendedDates.Semester","text":"Semester(dt::DateTime) -> Semester\n\nThe semester part of a DateTime as a Semester.\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.Semester-Tuple{Date}","page":"Home","title":"ExtendedDates.Semester","text":"Semester(dt::Date) -> Semester\n\nThe semester part of a Date as a Semester.\n\n\n\n\n\n","category":"method"},{"location":"#Dates.year-Tuple{Dates.UTInstant}","page":"Home","title":"Dates.year","text":"year(::UTInstant{<:Period})\n\nThe year of a period.\n\njulia> year(period(Day, 1960, 12))\n1960\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.dayofsemester-Tuple{TimeType}","page":"Home","title":"ExtendedDates.dayofsemester","text":"dayofsemester(dt::TimeType) -> Int\n\nReturn the day of the current semester of dt. Range of value is 1:184.\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.firstdayofsemester-Tuple{Date}","page":"Home","title":"ExtendedDates.firstdayofsemester","text":"firstdayofsemester(dt::TimeType) -> TimeType\n\nAdjusts dt to the first day of its semester.\n\nExamples\n\njulia> ExtendedDates.firstdayofsemester(DateTime(\"1996-05-20\"))\n1996-01-01T00:00:00\n\njulia> ExtendedDates.firstdayofsemester(DateTime(\"1996-08-20\"))\n1996-07-01T00:00:00\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.lastdayofsemester-Tuple{Date}","page":"Home","title":"ExtendedDates.lastdayofsemester","text":"lastdayofsemester(dt::TimeType) -> TimeType\n\nAdjusts dt to the last day of its semester.\n\nExamples\n\njulia> ExtendedDates.lastdayofsemester(DateTime(\"1996-05-20\"))\n1996-06-30T00:00:00\n\njulia> ExtendedDates.lastdayofsemester(DateTime(\"1996-08-20\"))\n1996-12-31T00:00:00\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.period-Union{Tuple{P}, Tuple{Type{P}, Vararg{Any}}} where P<:Period","page":"Home","title":"ExtendedDates.period","text":"period(::Type{<:Period}, year::Integer, subperiod::Integer = 1)\n\nConstruct a period from a year, subperiod, and frequency.\n\nThese periods are represented as an Int64 number of periods since an epoch defined by the ExtendedDates.epoch function. For most period types the epoch is Saturday, January 1, year 0. For week periods, it is Monday, January 3, year 0.\n\njulia> x = period(Semester, 2022, 1)\n2022-S1\n\njulia> Dates.format(x)\n\"2022-S1\"\n\njulia> Date(x)\n2022-01-01\n\njulia> Date(period(Week, 0))\n0000-01-03\n\njulia> Date(period(Day, 0))\n0000-01-01\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.semester-Tuple{Any}","page":"Home","title":"ExtendedDates.semester","text":"semester(dt::TimeType) -> Int64\n\nThe semester of a Date or DateTime as an Int64.\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.semesterofyear-Tuple{TimeType}","page":"Home","title":"ExtendedDates.semesterofyear","text":"semesterofyear(dt::TimeType) -> Int\n\nReturn the semester that dt resides in. Range of value is 1:2.\n\n\n\n\n\n","category":"method"},{"location":"#ExtendedDates.subperiod-Tuple{Dates.UTInstant}","page":"Home","title":"ExtendedDates.subperiod","text":"year(::UTInstant{<:Period})\n\nThe subperiod of a period within a year. Numbering starts at one.\n\njulia> subperiod(period(Day, 1960, 12))\n12\n\njulia> Date(period(Day, 1960, 12))\n1960-01-12\n\n\n\n\n\n","category":"method"}]
